% Projeto 6A = [3 2 4; 0 1/3 2/3; 0 0 -8];% Vetor de Equações da matriz triangular superiorb = [1; 5/3; 0]; % Vetor B da equação     X = []; % Vetor soluçãoX(3) = b(3)/A(3,3); %Valor Inicial do Vetor Soluçãofor k = length(A)-1: -1: 1  s = 0;  for j = k+1: 1: length(A)    s = s + A(k,j) * X(j)  end  X(k) = (b(k) - s)/A(k,k) %Valor na posição de X na posição K.enddisp("Tempo que o processador levou para executar o Método.")time = cputime()disp("Valores encontrados para os valores X.")X